import React from "react";

class ApiData extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      copright:"",
      date:""
    };
  }

  componentDidMount() {
  fetch(
      'https://api.nasa.gov/planetary/apod?api_key=7gTfQoM9v41twf39OxS7sgAZf8ILQ8np5c9eKa66')
      .then((res)=>res.json())
      .then((data)=>
      
      {
        console.log(data);
       this.setState({
         data
       })
    });
   
  }
  render() {
    return <div>{console.log(this.state)}</div>;
  }
}
export default ApiData;
